controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (game_started == true) {
        if (dash_cooldown == true) {
            dash_cooldown = false
            FLOWER.ay = 0
            if (characterAnimations.matchesRule(FLOWER, characterAnimations.rule(Predicate.FacingLeft))) {
                FLOWER.startEffect(extraeffects.coloredTrail)
                FLOWER.vx = -500
            }
            if (characterAnimations.matchesRule(FLOWER, characterAnimations.rule(Predicate.FacingRight))) {
                FLOWER.startEffect(extraeffects.coloredTrail)
                FLOWER.vx = 500
            }
            pause(100)
            FLOWER.vx = 0
            FLOWER.ay = 150
            effects.clearParticles(FLOWER)
            timer.after(1000, function () {
                dash_cooldown = true
            })
        }
    }
})
